    static void Main(string[] args)
    {
        var colors = "ABBBBBBBAAA";
        //var colors = "";
        Console.WriteLine(WinnerOfGame(colors));
    }

    public static bool WinnerOfGame(string colors)
    {
        int movesOfAlice = 0, movesOfBob = 0, repeatedA = 0, repeatedB = 0;
        foreach (var color in colors)
        {
            if(color == 'A')
            {
                repeatedA++;
                if (repeatedA > 2) movesOfAlice++;
                repeatedB = 0;
            } else
            {
                repeatedB++;
                if (repeatedB > 2) movesOfBob++;
                repeatedA = 0;
            }
        }        
        return movesOfAlice > movesOfBob;
    }

